g industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\r\n\r\n</div>\r\nHello this is home page, Welcome to the Website!, Hooray!','Home','','inherit','closed','closed','','71-revision-v1','','','2017-10-17 10:10:18','2017-10-17 10:10:18','',71,'http://localhost/wordpress/?p=82',0,'revision','',0),(83,1,'2017-10-17 10:25:35','2017-10-17 10:25:35','<strong>New Delhi</strong>: The Indian football team on Monday received a boost in FIFA rankings, a week after qualifying for the 2019 AFC Asian Cup by moving up two places to be at the 105th spot.\r\n<div id=\"attachment_4148987\" class=\"wp-caption alignleft\">\r\n\r\n<img class=\"size-full wp-image-4148987\" src=\"http://s1.firstpost.in/wp-content/uploads/2017/10/India-Asia-Cup-win_PTI3.jpg\" alt=\"Bengaluru : Indian Football players celebrates after they beat Macau by 4-1 during the AFC Asian cup qualifier match at Kanteerava Stadium in Bengaluru on Wednesday. PTI Photo by Shailendra Bhojak(PTI10_11_2017_000199B)\" width=\"380\" height=\"285\" />\r\n<p class=\"wp-caption-text\">Indian Football players celebrates after they beat Macau by 4-1 during the AFC Asian cup qualifier match in Bengaluru. PTI</p>\r\n\r\n</div>\r\nThe \'Blue Tigers\' were ranked 107th last month but they are now at 105th in the latest rankings, courtesy their win over Macau in the AFC Asian Cup 2019 qualifiers last week.\r\n\r\nWith 328 ranking points, India are just a rung below Zimbabwe and one spot above Niger.\r\n\r\nAmong the Asian Football Confederation countries, India are at 14th spot.\r\n\