 Asian Cup by moving up two places to be at the 105th spot.\r\n<div id=\"attachment_4148987\" class=\"wp-caption alignleft\">\r\n\r\n<img class=\"size-full wp-image-4148987\" src=\"http://s1.firstpost.in/wp-content/uploads/2017/10/India-Asia-Cup-win_PTI3.jpg\" alt=\"Bengaluru : Indian Football players celebrates after they beat Macau by 4-1 during the AFC Asian cup qualifier match at Kanteerava Stadium in Bengaluru on Wednesday. PTI Photo by Shailendra Bhojak(PTI10_11_2017_000199B)\" width=\"380\" height=\"285\" />\r\n<p class=\"wp-caption-text\">Indian Football players celebrates after they beat Macau by 4-1 during the AFC Asian cup qualifier match in Bengaluru. PTI</p>\r\n\r\n</div>\r\nThe \'Blue Tigers\' were ranked 107th last month but they are now at 105th in the latest rankings, courtesy their win over Macau in the AFC Asian Cup 2019 qualifiers last week.\r\n\r\nWith 328 ranking points, India are just a rung below Zimbabwe and one spot above Niger.\r\n\r\nAmong the Asian Football Confederation countries, India are at 14th spot.\r\n\r\nThe 4-1 win over Macau on 11 October saw India qualify for the 2019 AFC Asian Cup in the UAE.','India rankings in FIFA Football','','inherit','closed','closed','','83-revision-v1','','','2017-10-17 10:31:28','2017-10-17 10:31:28','',83,'http://localhost/wordpress/?p=85',0,'revision','',0),(86,1,'2017-10-17 11:07:52','2017-10-17 11:07:52','<div class=\"wrapper clearfix article-content-wrapper\">\r\n<div class=\"main-content\"><section class=\"title_section clearfix\">\r\n<h1 class=\"heading1\" data-articletitle=\"\">Supreme Court\'s judgment on privacy protects Aadhaar: Arun Jaitley</h1>\r\n</section><section class=\"highlight clearfix\">\r\n<h4 class=\"heading4\">Highlights</h4>\r\n<div id=\"mCSB_1\" class=\"mCustomScrollBox mCS-dark\">\r\n<div class=\"mCSB_container mCS_no_scrollbar\">\r\n<ul>\r\n 	<li>In its judgement in August SC decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution</li>\r\n 	<li>The judgement has been interpreted by many as a setback to the Aadhar card but Jaitley said exception had been carved out specifically to protect Aadhar</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<span class=\"img_cptn\">Arun Jaitley at Colombia University in New York (PTI image)</span>\r\n\r\n</section>\r\n<div class=\"article_content clearfix\">\r\n<div class=\"section1\">\r\n<div class=\"Normal\">\r\n\r\nWASHINGTON: The recent <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Supreme-Court\">Supreme Court</a> order on the <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/right-to-privacy\">right to privacy</a> lays down the correct exemptions which protects Aadhaar, finance minister <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Arun-Jaitley\">Arun Jaitley</a> has said.\r\n\r\nJaitley, who is in the US to attend the annual meetings of the IMF and the World Bank, was responding to a question at the prestigious <a class=\"key_underline\" href=\"https://timesofindia.indiatimes.com/topic/Columbia-University\">Columbia University</a> on how the government is planning to handle Aadhaar after the recent Supreme Court decision on the right to privacy.\r\n\r\nIn its judgment in August, a nine-judge bench decreed that that right to privacy is part of the fundamental rights to life and liberty enshrined in the Constitution.\r\n\r\nThe judgment has been interpreted by many as a setback to the Aadhaar card, under which the government collects vital personal information of the citizens.\r\n\r\n\"I do believe that the Supreme Court judgment on the privacy matter in accordance with the current timing is a correct judgement. It lays down the correct exceptions which protects Aadhaar,\" Jaitley told students.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Judgment on Aadhaar: Arun Jaitley','','inherit','closed','closed','','35-revision-v1','','','2017-10-17 11:07:52','2017-10-17 11:07:52','',35,'http://localhost/wordpress/?p=86',0,'revision','',0),(87,1,'2017-10-17 12:08:13','2017-10-17 12:08:13','{\n    \"lwp::lwp_link_color\": {\n        \"value\": \"#3ace00\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1\n    }\n}','','','trash','closed','closed','','719f3fe7-90f1-4794-aba2-670302a1e831','','','2017-10-17 12:08:13','2017-10-17 12:08:13','',0,'http://localhost/wordpress/?p=87',0,'customize_changeset','',0),(88,1,'2017-10-17 12:20:27','2017-10-17 12:20:27','{\n    \"lwp::lwp_btn_color\": {\n        \"value\": \"#2bbf33\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1\n    }\n}','','','trash','closed','closed','','f044ff28-af28-4025-b51c-a55839f3c317','','','2017-10-17 12:20:27','2017-10-17 12:20:27','',0,'http://localhost/wordpress/?p=88',0,'customize_changeset','',0),(89,1,'2017-10-20 06:50:57','2017-10-20 06:50:57','<div class=\"mod\" data-md=\"61\">\r\n<div class=\"_oDd\" data-hveid=\"38\"><span class=\"_Tgc\">plural. <b>scratch files</b>. Contribute to our Open Dictionary. a temporary computer <b>file</b>that is created to hold information while a program is being used. Computer <b>files</b>and documents and collections of computer data:access profile, archive, ASCII <b>file</b>...</span></div>\r\n</div>\r\n<div class=\"g\"></div>\r\n<div>\r\n<div>\r\n<div class=\"ds-list\"><span class=\"hvr\">(Computer</span> <span class=\"hvr\">Science)</span> <i><span class=\"hvr\">computing</span></i> a <span class=\"hvr\">temporary</span> <span class=\"hvr\">store</span> <span class=\"hvr\">for</span> <span class=\"hvr\">use</span> <span class=\"hvr\">during</span> <span class=\"hvr\">the</span> <span class=\"hvr\">execution</span> of a <span class=\"hvr\">program</span></div>\r\n</div>\r\n</div>','what do you mean by scratch files','','publish','open','open','','what-do-you-mean-by-scratch-files','','','2017-10-20 06:50:57','2017-10-20 06:50:57','',0,'http://localhost/wordpress/?p=89',0,'post','',0),(90,1,